import React from 'react'
import Testimonial from '../Despre/Testimonial'
import DropdownSelect from '../Joburi/DropdownSelect'
import { JobsData } from '../Joburi/JobsData'


function Jobs() {
    return (
        <div>
            <DropdownSelect />
            <Testimonial data={JobsData} />
        </div>
    )
}

export default Jobs
